  {url_type: "Media", url_title: "Virginia Museum Celebrates the 'Birthplace of Country Music'", url_desc: "The sounds of some of the earliest country music recordings are filling a new museum. But the Birthplace of Country Music Museum is not located in Nashville. Instead, it‚Äôs in Bristol, a small town on the Tennessee-Virginia state line in Virginia. The museum aims to tell the story of the Bristol Sessions, a series of historic recording sessions that took place here in 1927 and helped spread what was then known as ‚Äúhillbilly music‚Äù to the rest of the country.", url_keywords: "", story_id: 26, url_domain: "skift.com", url_full: "http://skift.com/2014/10/01/virginia-museum-celebrates-the-birthplace-of-country-music/", url_title_track: false, url_desc_track: false, url_keywords_track: true},
