  {url_type: "Media", url_title: "12 Reasons You Need To Go To Louisville This Fall (Or Anytime, Really)", url_desc: "There are many ways to pronounce Louisville and a lot of different ways to see this historic town. Full of Victorian architecture and traditions tied to the Kentucky Derby (mint juleps, big hats, Hot Browns), it's also a very young town bursting with life.", url_keywords: "12, reasons, you, need, to, go, to, louisville, this, fall, (or, anytime,, really), travel", story_id: 35, url_domain: "huffingtonpost.com", url_full: "http://www.huffingtonpost.com/2014/09/30/louisville-kentucky-live-travel-visit_n_5877812.html", url_title_track: true, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "Brooklyn's Urban Cowboy B&B Brings the Southwest to East Williamsburg\r\n | Food & Wine", url_desc: "With the exception of the massive, perpetually packed Wythe Hotel, Williamsburg has long been a ghost town when it comes to stylish hotel rooms. Now a new bed and breakfast has sprung up in residential East Williamsburg that perfectly captures the current Southwest-meets-reclaimed industrial design zetigeist, with great snacks to boot.", url_keywords: "", story_id: 36, url_domain: "foodandwine.com", url_full: "http://www.foodandwine.com/blogs/2014/10/1/brooklyns-urban-cowboy-b-and-b-brings-the-southwest-to-east-williamsburg", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "Brooklyn's Roberta's Puts Totonno's Pies to Shame", url_desc: "When the first pie landed on the table, our group of six nabbed slices eagerly. We'd made the pilgrimage to 90-year-old Totonno's on Coney Island and waited nearly an hour (at 4:30 p.m. on a Saturday afternoon) for our seats. We began eating, and then a silence fell. Each of us stared at our plates. Finally someone said the words we were all thinking: \"What's happened to the pizza?\"", url_keywords: "", story_id: 37, url_domain: "eater.com", url_full: "http://www.eater.com/2014/10/1/6875723/bill-addison-totonnos-robertas", url_title_track: false, url_desc_track: false, url_keywords_track: true},
