  {url_type: "Media", url_title: "19 Cult Food Destinations Worth Enduring An Insanely Long Wait In Line", url_desc: "When is it worth it to pack a book and hunker down for a comforting plate of fatty brisket or a hot, fresh doughnut?...", url_keywords: "19, cult, food, destinations, worth, enduring, an, insanely, long, wait, in, line, taste", story_id: 39, url_domain: "huffingtonpost.com", url_full: "http://www.huffingtonpost.com/2014/09/30/restaurants-with-long-lines_n_5884728.html", url_title_track: true, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "25 Best San Francisco Restaurants for Fall 2014 San Francisco/Bay Area  Area", url_desc: "While tourists flock to San Francisco during the summer months only to be bogged down by thick layers of fog, locals know that autumn offers some of the best weather for exploring the city. Get a taste of the Bay Area's rich culinary scene with GAYOT's guide to the top restaurants from Menlo Park to the Mission. This fall, take time to celebrate the diversity of San Francisco, which offers an overabundance of excellent restaurants, whether they be low-key ramen houses, neighborhood Italian eateries or hyper-modern bastions of haute-cuisine. Presented in alphabetical order, here are GAYOT's 25 best restaurants to eat at, right now.", url_keywords: "", story_id: 41, url_domain: "gayot.com", url_full: "http://www.gayot.com/restaurants/25-best-san-francisco-restaurants-fall-2014.html", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "California and Its Secret Sweet Tooth: 9 Places for Sweet Treats between Newport Beach and Fairfield", url_desc: "Yes, Californians may have a reputation for being healthy and fit, but that doesn't mean they don't know how to indulge once in a while. If you want proof, just take a look around the next Californian town or city you find yourself in. Chances are you'll discover one or more artisan shops specializing in chocolate, candies or baked goodies.", url_keywords: "california, and, its, secret, sweet, tooth:, 9, places, for, sweet, treats, between, newport, beach, and, fairfield, travel", story_id: 19, url_domain: "huffingtonpost.com", url_full: "http://www.huffingtonpost.com/flycom/california-and-its-secret_b_5889778.html", url_title_track: true, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "Meatless Monday: Portobello fries from Encontro", url_desc: "What is it? Portobello fries. Where is it from? Encontro North Park. What's in it? Crispy, fried portobello mushrooms topped with parmigiano-reggiano.", url_keywords: "meatless monday, vegetarian dishes san diego, best vegetarian restaurants san diego, veggie dishes san diego, discover sd mealtess monday, encontro north park, encontro north park portabella fries", story_id: 3559, url_domain: "discoversd.com", url_full: "http://www.discoversd.com/eat-drink/sd-ad-dsd-meatless-monday-20161024-story.html", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "Actors to Chefs to Sultans: 9 Unlikely Hotel Owners", url_desc: "Owning and operating a hotel is a full-time job, and many of those who devote their lives to the hospitality industry specialize in all things hotel ‚Äî and that‚Äôs it. But there are some unlikely faces in the exclusive ‚Äúhotel owners of the world‚Äù club (hey, it probably exists) that got their starts in other industries; in fact, most of them have their hands in many pots and own their hotels while simultaneously acting, directing, cooking, designing, singing, running a country‚Ä¶.you name it! So here we bring you nine surprising hotel owners, from chefs to sultans.", url_keywords: "Anguilla, Belize, Las Vegas, Los Angeles, Miami, Milan, New York City, Paris, Vermont", story_id: 30, url_domain: "blog.oyster.com", url_full: "http://blog.oyster.com/actors-to-chefs-to-sultans-9-unlikely-hotel-owners-49666/", url_title_track: true, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "10 Best Chicago Restaurants for Fall 2014 Chicago  Area", url_desc: "Fall is a great time to get a taste of Chicago's exciting culinary scene before hunkering down for the long, cold winter that lies ahead. Use our guide to the best of the Windy City to discover the hottest kitchens in town, even as the evenings get chilly. Whether you're craving whiskey and tacos in Wicker Park or looking for a place to BYOB on the Far North Side, we've scouted out spots across the city where you can stop in for a mouth-watering meal. Presented in alphabetical order, here are GAYOT's 10 best restaurants to eat at, right now.", url_keywords: "", story_id: 42, url_domain: "gayot.com", url_full: "http://www.gayot.com/restaurants/10-best-chicago-restaurants-fall-2014/main.html", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "25 Best New York Restaurants for Fall 2014  NYC New York  Area", url_desc: "Fall is a time of pleasant change for New York. The hot and humid summer weather has left, as have the hordes of tourists, and restaurants across the city are changing over their menus for the new season. While the dining options are endless, we've whittled down our list to 25 must-visit eateries from Brooklyn to the Bowery. From hearty fall fare at Monument Lane and Paulaner, to elevated Malaysian cuisine at Pasar Malam, these dining hot spots are sure to make for an interesting autumn. Presented in alphabetical order, here are GAYOT's 25 best restaurants to eat at, right now.", url_keywords: "", story_id: 43, url_domain: "gayot.com", url_full: "http://www.gayot.com/restaurants/25-best-new-york-restaurants-fall-2014.html", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "2014 Best - Top 10 Italian Restaurants in the US", url_desc: "Italian food is an undeniable part of the American dining landscape. Nearly every neighborhood has its own red sauce joint, run by a local nonna who's been cooking up her famous lasagna the same way for decades. But today's modern Italian restaurants strive for something more, like handmade pastas, rustic regional recipes and exquisite surroundings. From Tampa Bay to Los Angeles, Italian restaurants are as popular as always ‚Äî and better than ever. Presented in alphabetical order, these are the top 10 Italian restaurants in the United States.", url_keywords: "", story_id: 44, url_domain: "gayot.com", url_full: "http://www.gayot.com/restaurants/top-10-italian/main.html", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "8 majestic castle hotels", url_desc: "We have no kings or queens in the United States, but we do have the rich, who have long built great houses as symbols of their power, wealth and pride.", url_keywords: "", story_id: 46, url_domain: "cnn.com", url_full: "http://www.cnn.com/2014/10/08/travel/us-castle-hotels/", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "Nevada‚Äôs secret underwater world", url_desc: "When it was built in the 1930s, the Hoover Dam didn‚Äôt just tame the Colorado River ‚Äì it also created a massive lake that today hides shipwrecks, train tracks and cement tunnels alike.", url_keywords: "", story_id: 47, url_domain: "bbc.com", url_full: "http://www.bbc.com/travel/feature/20140917-nevadas-secret-underwater-world", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "A Successful L.A. Mexican Restaurant's Glamorous Hollywood History", url_desc: "AAs a child, it was not out of the ordinary for Christy Vega to work at her family‚Äôs California restaurant and see Marlon Brando at one table and Cary Grant at another. Celebrities put Casa Vega on the map during the golden age of Hollywood, and the popularity of the Mexican restaurant has continued to this day.", url_keywords: "", story_id: 48, url_domain: "nbcnews.com", url_full: "http://www.nbcnews.com/news/latino/successful-l-mexican-restaurants-glamorous-hollywood-history-n219521", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "7 Ways to Maximize Your Visit to Bottega Americano", url_desc: "After months of anticipation, Bottega Americano is finally open, and eager diners are ready to hop from station to station and dive into its Cal-Italian cuisine. But before your visit, here are a few tips about East Village‚Äôs hottest restaurant.", url_keywords: "", story_id: 49, url_domain: "zagat.com", url_full: "http://www.zagat.com/b/san-diego/7-ways-to-maximize-your-visit-to-bottega-americano", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "San Diego‚Äôs Best Mexican Food Joints", url_desc: "There‚Äôs no denying it: Mexican cuisine is an important staple of the San Diego food scene. With Mexico‚Äôs Independence Day coming up on Sept. 16, there‚Äôs no better way to celebrate our southern neighbors than to enjoy delicious Mexican dishes. Whether you‚Äôre in the mood for sizzling fajitas, a freshly-rolled burrito or just a nice, cold margarita, these Yelp approved business are hotter than the salsa you‚Äôre now craving.", url_keywords: "Mexican food, tacos, burritos, enchiladas, Mexico Independence Day, San Diego, food, dining, restaurants, entertainment, Yelp, La Jolla, Vista, Kensington, Oceanside, Hillcrest, San Marcos Oscar's Mexican Seafood, El Ranchero, Ponce's, La Perla Tapatia", story_id: 52, url_domain: "nbcsandiego.com", url_full: "http://www.nbcsandiego.com/news/local/Highly-Ranked-Mexican-Food-San-Diego-Yelp-273806761.html", url_title_track: false, url_desc_track: false, url_keywords_track: true},
