  {url_type: "Media", url_title: "Seattle's 11 most underrated restaurants, according to experts", url_desc: "Of all the things people from Seattle love, number one is probably... um, polar fleece (you can wear it anywhere!). But after that, it's probably restaurants. Seriously, it doesn't matter if it's one of the city's best new places to eat, or one of hundreds of teriyaki spots, people here just love restaurants, so much so you'd think there'd be enough love to go around, but sadly there's not. That's why we asked some serious food experts, from Ethan Stowell to Renee Erickson, to help us pick places in need of more love. The result? Our list of Seattle's 11 most underrated restaurants...", url_keywords: "Thrillist, Jackthreads, Thrillist Rewards, rewards, near, eat, drink, shop, daily email", story_id: 60, url_domain: "thrillist.com", url_full: "http://www.thrillist.com/eat/seattle/most-underrated-restaurants-in-seattle", url_title_track: false, url_desc_track: false, url_keywords_track: true},
