  {url_type: "Media", url_title: "Top 10 'Wizard of Oz' destinations", url_desc: "In celebration of this classic piece of cinematic history, we‚Äôve tracked down 10 'Wizard of Oz' destinations every Oz fan should visit.", url_keywords: "", story_id: 113, url_domain: "cheapflights.com", url_full: "http://www.cheapflights.com/news/top-10-wizard-of-oz-destinations/", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "Get your trunks on: the world's best public swimming pools", url_desc: "Whether it‚Äôs for the exercise, a cooling dip as temperatures soar, or just the sheer fun of splashing around, the following selection of public pools dotted around the globe offer not only memorable settings, but also convenient access to highlights for tourists, making it easy to combine your swim with some classic sightseeing.", url_keywords: "", story_id: 115, url_domain: "lonelyplanet.com", url_full: "http://www.lonelyplanet.com/pacific/travel-tips-and-articles/get-your-trunks-on-the-worlds-best-public-swimming-pools", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "10 best record stores in the USA", url_desc: "Vinyl is back! Or it never left, depending on the social circles you frequent. But there's no arguing that sales are rebounding dramatically and in a world of opportunist bandwagoners, you need to know the die-hard purists from the profiteering poseurs. You can feel confident, nay triumphant, by shopping at any of the following stores.", url_keywords: "", story_id: 116, url_domain: "usatoday.com", url_full: "http://www.usatoday.com/story/experience/weekend/lifestyle/2014/05/20/10-best-record-stores-in-america/9332657/", url_title_track: true, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "The 33 best cocktail bars in America", url_desc: "Over the course of many years here at Thrillist, we‚Äôve written about cocktail bars in nearly every city across the US (and the world!), so it only made sense that we‚Äôd take that knowledge and pick out our 33 best cocktail bars in the country. We‚Äôre not aiming for the new, hot ones (though some are on here) -- just strictly the best places to get delicious cocktails -- both innovative and classic -- ideally without pretension, attitude, or crappy cocktail napkins that stick to the bottom of your glass. And -- as a bonus -- we asked our British and Canadian editors to pick their favorite cocktail bars, too, so you can enjoy boozy perfection wherever you go.", url_keywords: "Thrillist, Jackthreads, Thrillist Rewards, rewards, near, eat, drink, shop, daily email", story_id: 117, url_domain: "thrillist.com", url_full: "http://www.thrillist.com/drink/nation/the-33-best-cocktail-bars-in-the-country", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "America's Coolest Music Venues", url_desc: "Fine-tune your concert experience by sampling one of these cool outdoor arenas or intimate clubs.", url_keywords: "America's Coolest Music Venues articles, America's Coolest Music Venues stories, America's Coolest Music Venues facts", story_id: 118, url_domain: "travelandleisure.com", url_full: "http://www.travelandleisure.com/articles/americas-coolest-music-venues", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "Drive-through animal safaris", url_desc: "Take a walk, or rather drive, on the wild side. These tours are going to get up close and personal with some of the largest mammals and most exotic species that roam the earth, all from the comfort of your vehicle. No longer does a safari require sleeping in a canvas tent on the Serengeti. Now, adventurers can experience wildlife from around the world in their own backyard. Check out these top ten drive-through safaris that are not to be missed.", url_keywords: "", story_id: 120, url_domain: "usatoday.com", url_full: "http://www.usatoday.com/experience/weekend/my-weekend-experience/10-best-drive-through-animal-safaris/9729419/", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "The best new beer restaurants", url_desc: "What‚Äôs brewing in food right now? Beer, of course. For so very long, beer was an afterthought on the menu of nearly every restaurant you stepped foot in; always a few boring bottles that so obviously didn‚Äôt go with pasta primavera, you had no choice but to opt for chardonnay. Those days are behind us‚Äîand we know that because there are enough new beer-driven eateries that we actually found favorites among them. From a vegetarian pickle shop in Brooklyn to a German beer hall in Seattle, these restaurants have two things in common: They‚Äôre all less than a year old, and they‚Äôre all churning out inspired plates and putting serious thought into pints that match. Three of them have ‚ÄúTop Chef‚Äù alums, and six are attached to breweries; all of them have food and beer that will blow you away.", url_keywords: "", story_id: 110, url_domain: "draftmag.com", url_full: "http://draftmag.com/features/the-best-new-beer-restaurants/", url_title_track: true, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "Coolest Speakeasies In America", url_desc: "It's been 81 years since the repeal of Prohibition, when the nation dried up and hidden bars called speakeasies popped up all over the country. While the temperance movement is long gone, the secret watering holes haven't changed much, from the passwords required on entry to the caliber of handcrafted cocktails served. We dug up the hottest and most exclusive speakeasies in the U.S., and even gave away their addresses. Let's keep this one on the DL.", url_keywords: "", story_id: 121, url_domain: "businessinsider.com", url_full: "http://www.businessinsider.com/coolest-speakeasies-in-america-2014-8", url_title_track: false, url_desc_track: false, url_keywords_track: true},
  {url_type: "Media", url_title: "Drink Up These Classic California Wineries", url_desc: "Everyone knows that wine is better when aged. The wineries where these vintages are made are even more special because they themselves are historic. Find", url_keywords: "winery, california wine, wine, historic wineries, sonoma, napa, vitners, simi winery, spring moutain vinyard, buena vista winery, korbel california champagne, gundlach bundschu", story_id: 122, url_domain: "findeverythinghistoric.com", url_full: "http://www.findeverythinghistoric.com/blog/friday-top-5-drink-up-these-classic-california-wineries/", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "Most Popular Family-Friendly Restaurants", url_desc: "Our list of the Most Popular Family-Friendly Restaurants received the most positive reviews from professional food critics, bloggers, and diners.", url_keywords: "", story_id: 300, url_domain: "urbanspoon.com", url_full: "http://www.urbanspoon.com/blog/2013/06/americas-most-popular-family-friendly-restaurants/", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "8 Reasons to Visit Philadelphia for the Holidays", url_desc: "Through the New Year, history-rich, foodie-friendly Philadelphia's calendar is chockablock with special events, attractions, and distinctly Philly activities for fun-seekers and families of all kinds.", url_keywords: "", story_id: 392, url_domain: "fodors.com", url_full: "http://www.fodors.com/news/8-reasons-to-visit-philadelphia-for-the-holidays-7319.html", url_title_track: false, url_desc_track: true, url_keywords_track: true},
  {url_type: "Media", url_title: "Top 10 Celeb-Inspired Cheeseburger Joints in the US", url_desc: "How do you make a cheeseburger an even more all-American meal? Throw in a side of pop culture and a dash of creativity. Chefs across the U.S. are constantly reinventing the cheeseburger and the good ol‚Äô burger joint, drawing on the heroes of movies, music, politics and more for inspiration. Read on for our top 10 favorites of these all-American restaurants where celebrities are inspiring the dish of the day.", url_keywords: "", story_id: 125, url_domain: "cheapflights.com", url_full: "http://www.cheapflights.com/news/top-10-celeb-inspired-cheeseburger-joints-us/", url_title_track: false, url_desc_track: false, url_keywords_track: true}
])
